import React from 'react';
import s from './Projects.module.css';

function Projects() {
    return (
        <div className={s.body}>
           <span id={s.projects_header}>Projects</span>

           {/*styles of project's cart */}
           <div className={s.projectCart}>
               <span id={s.project_name}>TigranKheranyan-Portfolio</span>
               <span id={s.about_project}>Software Developer Portfolio Template that helps you showcase your work and skills...</span>
               <div>
                   <li>JavaScipt</li>
                   <span>1000KB</span>
               </div>
           </div>
        </div>
    );
}

export default Projects;
